[Version]
rocksdb_version=6.20.3
options_file_version=1.1

[DBOptions]
create_if_missing = true
writable_file_max_buffer_size=268435456
max_open_files = 4096
max_file_opening_threads=4096

[CFOptions "default"]
max_write_buffer_number=6
write_buffer_size=268435456
target_file_size_base=268435456
max_bytes_for_level_base=20831838208
max_compaction_bytes=20831838208
level_compaction_dynamic_level_bytes=false
level0_stop_writes_trigger=100
target_file_size_multiplier=4
max_bytes_for_level_multiplier=8
compression=kNoCompression
compaction_style=kCompactionStyleLevel
